import Header from './components/Header'
import CompanyBio from './CompanyBio'
import Home from './Home'

import {Route, Link} from 'react-router-dom'

function App() {
  return (
    <>
      <Router to="/" component={Home} />
      <Router to="/bio" component={CompanyBio} />      
    </>



  );
}

export default App;
